
create table region_sido (
    sido_cd                 varchar(2) not null primary key comment '시도 코드',
    sido_nm                 varchar(32) not null comment '시도명',
    sido_short_nm           varchar(16) null comment '시도명(2자리명)',
    sido_ord                integer default 0 not null comment '정렬 순서'
) ENGINE=InnoDB  charset=utf8 comment '법정시군구 코드';

create table region_sigungu (
    sigungu_cd              varchar(5) not null primary key comment '시군구 코드',
    sido_cd                 varchar(2) not null comment '시도 코드',
    sigungu_nm              varchar(32) null comment '시군구명',
    sigungu_nm_old          varchar(32) null comment '예전 시군구명',
    sigungu_nm_full         varchar(64) null comment '시도 시군구명',
    foreign key(sido_cd) references region_sido(sido_cd) on delete cascade
) ENGINE=InnoDB  charset=utf8 comment '법정동코드';


ON DUPLICATE KEY UPDATE
    sido_nm = VALUES(sido_nm),
    sido_short_nm = VALUES(sido_short_nm),
    sido_ord = VALUES(sido_ord),
    nx = VALUES(nx),
    ny = VALUES(ny)
;





create table region_district
(
    district_cd             varchar(8)    not null comment '행정구역코드',
    district_name           varchar(32)   not null comment '행정구역명(읍,면,동)',
    sido_cd                 varchar(2)    not null comment '시도 코드',
    sigungu_cd              varchar(5)    not null comment '시군구 코드',
    nx                      int           not null comment '기상청 예보지점 X좌표',
    ny                      int           not null comment '기상청 예보지점 Y좌표',
    longitude               double        not null comment '경도',
    latitude                double        not null comment '위도',
    create_date       datetime not null comment '생성일',
    primary key (district_cd)
) ENGINE=InnoDB  charset=utf8 COMMENT '행정구역별 격자 좌표 및 위/경도. 기상청 실황 및 단기예보 사용';

;


update region_district
set sido_cd = SUBSTR( district_cd, 1, 2 )
where sido_cd = ''
;

update region_district
set sigungu_cd = SUBSTR( district_cd, 1, 5 )
where sigungu_cd = ''
;